import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate, useNavigate } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import Profile from './components/Profile';
import Stores from './components/Stores';
import Products from './components/Products';
import Storefront from './components/Storefront';
import Cart from './components/Cart';
import Checkout from './components/Checkout';
import NavBar from './components/NavBar';
import OrderConfirmation from './components/OrderConfirmation';
import './styles/App.css';

const NavigationBox = () => {
    const navigate = useNavigate();

    const handleNavigate = (path) => {
        navigate(path);
    };

    return (
        <div className="navigation-box">
            <div className="nav-icon" onClick={() => handleNavigate('/products')}>
                <img src="/images/order.png" alt="Products" />
            </div>
            <div className="nav-icon" onClick={() => handleNavigate('/stores')}>
                <img src="/images/myorders.png" alt="Stores" />
            </div>
            <div className="nav-icon" onClick={() => handleNavigate('/logout')}>
                <img src="/images/logout.png" alt="Logout" />
            </div>
        </div>
    );
};

function App() {
  return (
    <Router>
      <NavigationBox />
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/profile" element={<NavBar><Profile /></NavBar>} />
        <Route path="/stores" element={<NavBar><Stores /></NavBar>} />
        <Route path="/products" element={<NavBar><Products /></NavBar>} /> 
        <Route path="/storefront/:storeId" element={<NavBar><Storefront /></NavBar>} />
        <Route path="/cart" element={<NavBar><Cart /></NavBar>} />
        <Route path="/checkout" element={<NavBar><Checkout /></NavBar>} />      
        <Route path="/order-confirmation" element={<NavBar title="My Orders"><OrderConfirmation /></NavBar>} />         
        <Route path="/" element={<Navigate to="/login" />} />
      </Routes>
    </Router>
  );
}

export default App;
